async function loadFile() {
    const repoName = document.getElementById('repoName').value;
    const branchName = document.getElementById('branchName').value;
    const filePath = document.getElementById('filePath').value;

    try {
        const response = await fetch(`${githubUrl}/repos/${repoName}/contents/${filePath}?ref=${branchName}`, {
            headers: {
                'Authorization': `token ${token}`
            }
        });
        const data = await response.json();

        if (response.ok) {
            const content = decodeBase64(data.content);
            editor.setValue(content);
            const fileExtension = filePath.split('.').pop();
            const mode = getModeFromExtension(fileExtension);
            editor.setOption('mode', mode);

            document.getElementById('deleteButton').style.display = 'inline-block';

            Swal.fire('成功', '文件已成功加载', 'success');
        } else {
            Swal.fire('无法加载文件', data.message, 'error');
            document.getElementById('deleteButton').style.display = 'none';
        }
    } catch (error) {
        console.error('请求出错:', error);
        Swal.fire('请求出错', error.message, 'error');
        document.getElementById('deleteButton').style.display = 'none';
    }
}

async function saveFile() {
    const repoName = document.getElementById('repoName').value;
    const branchName = document.getElementById('branchName').value;
    const filePath = document.getElementById('filePath').value;
    const fileContent = editor.getValue();

    const timestamp = new Date().toISOString().replace('T', ' ').substring(0, 19);
    const userIP = await getUserIP();

    try {
        const getFileResponse = await fetch(`${githubUrl}/repos/${repoName}/contents/${filePath}?ref=${branchName}`, {
            headers: {
                'Authorization': `token ${token}`
            }
        });

        if (getFileResponse.ok) {
            const fileData = await getFileResponse.json();

            const updateResponse = await fetch(`${githubUrl}/repos/${repoName}/contents/${filePath}`, {
                method: 'PUT',
                headers: {
                    'Authorization': `token ${token}`,
                    'Content-Type': 'application/json'
                },
                body: JSON.stringify({
                    content: encodeBase64(fileContent),
                    sha: fileData.sha,
                    message: `${timestamp} by ${userIP}`
                })
            });

            const updateData = await updateResponse.json();

            if (updateResponse.ok) {
                Swal.fire('成功', '文件已成功保存', 'success');
            } else {
                Swal.fire('无法保存文件', updateData.message, 'error');
            }
        } else {
            const createResponse = await fetch(`${githubUrl}/repos/${repoName}/contents/${filePath}`, {
                method: 'PUT',
                headers: {
                    'Authorization': `token ${token}`,
                    'Content-Type': 'application/json'
                },
                body: JSON.stringify({
                    content: encodeBase64(fileContent),
                    message: `${timestamp} by ${userIP}`
                })
            });

            if (createResponse.ok) {
                Swal.fire('成功', '文件已成功创建', 'success');
            } else {
                const createData = await createResponse.json();
                Swal.fire('无法创建文件', createData.message, 'error');
            }
        }
    } catch (error) {
        console.error('请求出错:', error);
        Swal.fire('请求出错', error.message, 'error');
    }
}

async function deleteFile() {
    const repoName = document.getElementById('repoName').value;
    const branchName = document.getElementById('branchName').value;
    const filePath = document.getElementById('filePath').value;

    const timestamp = new Date().toISOString().replace('T', ' ').substring(0, 19);
    const userIP = await getUserIP();

    try {
        const getFileResponse = await fetch(`${githubUrl}/repos/${repoName}/contents/${filePath}?ref=${branchName}`, {
            headers: {
                'Authorization': `token ${token}`
            }
        });
        const fileData = await getFileResponse.json();

        if (getFileResponse.ok) {
            const deleteResponse = await fetch(`${githubUrl}/repos/${repoName}/contents/${filePath}`, {
                method: 'DELETE',
                headers: {
                    'Authorization': `token ${token}`,
                    'Content-Type': 'application/json'
                },
                body: JSON.stringify({
                    sha: fileData.sha,
                    message: `Deleted ${filePath} | ${timestamp} by ${userIP}`
                })
            });

            if (deleteResponse.ok) {
                Swal.fire('成功', '文件已成功删除', 'success');
                document.getElementById('deleteButton').style.display = 'none';
            } else {
                const deleteData = await deleteResponse.json();
                Swal.fire('无法删除文件', deleteData.message, 'error');
            }
        } else {
            Swal.fire('无法删除文件', '文件不存在', 'error');
        }
    } catch (error) {
        console.error('请求出错:', error);
        Swal.fire('请求出错', error.message, 'error');
    }
}